// Sort suppliers alphabetically
const sortedSuppliers = suppliers.sort((a, b) => {
  if (a.name.toLowerCase() < b.name.toLowerCase()) {
    return -1;
  }
});

// Create cards for all suppliers
function popSuppliers() {
  sortedSuppliers.forEach((supplier) => {
    let currentDate = new Date();
    let postgresDate = new Date(supplier.go_live_date);
    let supplierLink = document.createElement("a");
    supplierList.append(supplierLink);
    supplierLink.outerHTML = `<a href="${supplier.url}" class="supplier-info-center-card" ${ 
      (supplier.active == true && currentDate >= postgresDate) || 
      (supplier.active == true && supplier.go_live_date == null) 
        ? "" 
        : "style=display:none;" 
    }>
    <div>
        ${supplier.logo ? `<img src="${supplier.logo}">` : ""}
      <div class="supplier-name">
        <span>
          ${supplier.name}
        </span>
      </div>
      <div class="supplier-info-center-card-learn-more">
        <p>Learn More</p>
      </div>
    </div>
  </a>`;
  });
}

// Remove all supplier cards and then recreate cards for suppliers in selected state
function selectState(state) {
  let supplierCards = document.querySelectorAll(".supplier-info-center-card");
  supplierCards.forEach((div) => {
    div.remove();
  });
  if (state == "All") {
    popSuppliers();
  } else {
    sortedSuppliers.forEach((supplier) => {
      let currentDate = new Date();
      let postgresDate = new Date(supplier.go_live_date);
      if (supplier.service_area && supplier.service_area.includes(state)) {
        supplierLink = document.createElement("a");
        supplierList.append(supplierLink);
        supplierLink.outerHTML = `<a href="/${supplier.url}" class="supplier-info-center-card" ${ 
          (supplier.active == true && currentDate >= postgresDate) || 
          (supplier.active == true && supplier.go_live_date == null) 
            ? "" 
            : "style=display:none;" 
        }>
      <div>
      ${supplier.logo ? `<img src="${supplier.logo}">` : ""}
        <div class="supplier-name">
          <span>
            ${supplier.name}
          </span>
        </div>
        <div class="supplier-info-center-card-learn-more">
          <p>Learn More</p>
        </div>
      </div>
    </a>`;
      }
    });
  }
}